import React from 'react';
import './Services.css';
const Services = () => {
  return (
    <div className="services">
      <h1>Our Services</h1>
      <ul>
        <li>Primary Care</li>
        <li>Emergency Services</li>
        <li>Surgical Services</li>
        <li>Specialty Care</li>
        <li>Diagnostic Services</li>
      </ul>
    </div>
  );
}

export default Services;
